This makes it possible to import the module with the es6 syntax without typescript optimizing it away automatically when it is only used for module dependencies. For instance, doing something like the following will cause 'angular-ui-router' to not be included in the final js file:

```
import * as angular from 'angular';
import router from 'angular-ui-router';

export default angular.module('app', ['ui.router', ...]);
```

This PR enables us to write it like this instead which will not be optimized away.

```
import * as angular from 'angular';
import router from 'angular-ui-router';

export default angular.module('app', [router, ...]);
```

Adds the missing createInstance() method:

You can create multiple instances of localForage that point to different stores using createInstance. All the configuration options used by config are supported.

```
var store = localforage.createInstance({
  name: "nameHere"
});

var otherStore = localforage.createInstance({
  name: "otherName"
});

// Setting the key on one of these doesn't affect the other.
store.setItem("key", "value");
otherStore.setItem("key", "value2");
```

Previously, you had to extend `React.Props<T>` (specifying instance type `T` explicitly) to allow callers to create elements with `key` and `ref` attributes. We now infer `T` automatically and utilize intersection types to accept `key` and `ref`:

``` ts
declare function createElement<P, T extends Component<P, {}>, C extends ComponentClass<P>>(
    type: C & (new() => T) & (new() => { props: P }),
    props?: P & { key?: Key; ref?: Ref<T> },
    ...children: ReactNode[]): ComponentElement<P, T>;
```

This PR introduces a new `React.ComponentElement<P, T>` type, which allows us to return the correct type `T` from `ReactDOM.render` (previously the best we could do was `Component<P, {}>`). I'm personally pretty excited about this.
## Breaking Changes
- `React.Props<T>` is now deprecated, which means that `key` and `ref` can't be accessed on `this.props` anymore. `children` is still available for the time being since we can't prevent it from being passed via `createElement` (h/t @adidahiya)
- `React.ReactHTMLElement` now takes a type parameter `<T extends HTMLElement>`
- `React.DOMElement` takes two type parameters `<P extends DOMAttributes, T extends Element>`
- same changes to `React.HTMLFactory` and `React.DOMFactory`
## New Interfaces

Attributes (analogous to `JSX.IntrinsicAttributes` and `JSX.IntrinsicClassAttributes<T>`):

``` ts
interface Attributes {
    key?: Key;
}
interface ClassAttributes<T> extends Attributes {
    ref?: Ref<T>;
}
```

Component Elements (aliased as `CElement`):

``` ts
interface ComponentElement<P, T extends Component<P, {}>> extends ReactElement<P> {
    type: ComponentClass<P>;
    ref?: Ref<T>;
}
```

Stateless Functional Component Elements (no `ref`):

``` ts
interface SFCElement<P> extends ReactElement<P> {
    type: StatelessComponent<P>;
}
```
## Other Changes
- added documentation to `README.md` on known problems and workarounds. I'd say `cloneElement` is the weakest link in these type definitions.
- made a number of `isXXX(...): boolean` API functions into custom typeguards
- added `nonce` and `reversed` HTML attributes to bring us up to date with React 0.14.4

